import axios from 'axios';
function Schedule()
{
    const [arr, arrset] = useState([]);
    useEffect(async () => {
        try {
            console("TFyghuji");
            const data = await axios.get("/user");
            console.log(data.data);
            arrset(data.data.data);
        } catch (err) {
            console.log(err);
        }
    }, [])
    return(
        <>
            <h1>Schedule An Interview</h1>
            <div className='few'>
            {/* { arr && arr?.map((ele, key) =>
            <div>
                <h2>{ele.email}</h2>
            </div>
            )} */}
            </div>
        </>


    )
}



export default Schedule
